import React from 'react';
import './Input.css';

const input=(props)=>{
let inputElement=null;

switch(props.inputtype){
    case ('input'):
        inputElement =<input className="InputElement" 
        {...props.elementconfig} 
        value={props.value}/>;
        break
        case('textarea'):
        inputElement =<textarea className="InputElement" 
        {...props.elementconfig} 
        value={props.value}/>;
        break
        default:
            inputElement=<input className="InputElement" 
            {...props.elementconfig} 
            value={props.value}/>;

}

return(
    <div className="Input">
    <label className="Label"> {props.label}</label>
    {inputElement}
</div>
);

};



export default input;
